import React, { useState } from 'react';
import { Modal } from 'react-bootstrap';

function DismissableAlert(t) {
    const [showAlert, setShowAlert] = useState(false);

    return (
        <Modal.Dialog>
            <Modal.Body>
                <p>{t.text}</p>
            </Modal.Body>
        </Modal.Dialog>
    );
}

export default DismissableAlert;
